import * as FaIcons from "react-icons/fa";
import * as BaIcons from "react-icons/bs";
export const SidebarData=[
    {
        title: "Home",
        path: "/",
        icon: <FaIcons.FaHome />,
      },
      {
        title: "Adminusers",
        path: "/git",
        icon: <FaIcons.FaUserCheck />,
      },
      {
        title: "Ads",
        path: "/css",
        icon: <FaIcons.FaBriefcase/>,
      },
      {
        title: "jobs",
        path: "/php",
        icon: <FaIcons.FaBriefcase/>,
      },
      {
        title: "Company",
        path: "/java",
        icon: <FaIcons.FaBuilding/>,
      },
     
      {
        title: "Userprofiles",
        path: "/node",
        icon: <FaIcons.FaNodeJs />,
      },
      {
        title: "Figma",
        path: "/figma",
        icon: <FaIcons.FaFigma />,
      },
      {
        title: "Angular",
        path: "/angular",
        icon: <FaIcons.FaAngular />,
        
      },
      {
        title: "React",
        path: "/react",
        icon: <FaIcons. FaReact />,
       
      },
]
